      scale: 0,
      duration: 1,
      transformOrigin: "top center",
      ease: "Power3.easeOut",
    },
    "<+=0.3"
  );

  var lineDrawing = anime({
    targets: "#path",
    strokeDashoffset: [anime.setDashoffset, 0],
    easing: "easeInOutCubic",
    duration: 4000,
    autoplay: false,
    update: function (anim) {
      if (anim.progress > progress) {
        progress = anim.progress;
      }

      if (Math.round(progress) >= 32) {
        group_1.play();
      }

      if (Math.round(progress) >= 42) {
        group_2.play();
      }

      if (Math.round(progress) >= 50) {
        group_3.play();
      }

      if (Math.round(progress) >= 58) {
        group_4.play();
      }

      if (Math.round(progress) >= 70) {
        group_5.play();
      }

      if (Math.round(progress) == 100) {
        animBoolean = true;
      }
    },
  });

  const scrollPercent = () => {
    const bodyST = document.body.scrollTop;
    const docST = document.documentElement.scrollTop;
    const docSH = document.documentElement.scrollHeight;
    const docCH = document.documentElement.clientHeight;

    return ((docST + bodyST) / (docSH - docCH)) * 180;
  };

  window.onscroll = () => {
    if (animBoolean == false) {
      if (scrollProgress < (scrollPercent() / 100) * lineDrawing.duration) {
        scrollProgress = (scrollPercent() / 100) * lineDrawing.duration;
      }
      if (Math.round(progress) < 70) {
        lineDrawing.seek(scrollProgress);
      } else {
        lineDrawing.play();
      }
      // lineDrawing.seek(scrollProgress);
    } else {
      lineDrawing.pause();
    }
  };

  const lenis = new Lenis({
    duration: 1,
    easing: (t) => 1 - Math.pow(1 - t, 3),
    direction: "vertical",
    gestureDirection: "vertical",
    smooth: true,
    mouseMultiplier: 1,
    smoothTouch: false,
    touchMultiplier: 2,
    infinite: false,
  });

  function raf(time) {
    lenis.raf(time);
    requestAnimationFrame(raf);
  }

  requestAnimationFrame(raf);
